-- operators
local op_inc_dp  = 1
local op_dec_dp  = 2
local op_inc_val = 3
local op_dec_val = 4
local op_out     = 5
local op_in      = 6
local op_jmp_fwd = 7
local op_jmp_bck = 8

local operator   = 1
local operand    = 2

local string = string
local table  = table

function complieBf(input)
    local pc       = 0
    local jmpPc    = 0
    local jmpStack = {}
    local program  = {
        -- operator,
        -- operand
    }
    local c = ""
    local inputLen = #input
    for i = 1, inputLen do
        c = string.sub(input, i, i)
        if c == ">" then
            table.insert(program, {op_inc_dp, 0})
        elseif c == "<" then
            table.insert(program, {op_dec_dp, 0})
        elseif c == "+" then
            table.insert(program, {op_inc_val, 0})
        elseif c == "-" then
            table.insert(program, {op_dec_val, 0})
        elseif c == "." then
            table.insert(program, {op_out, 0})
        elseif c == "," then
            table.insert(program, {op_in, 0})
        elseif c == "[" then
            table.insert(program, {op_jmp_fwd, 0})
            table.insert(jmpStack, pc + 1)
        elseif c == "]" then
            if #jmpStack == 0 then
                return nil
            end
            local jmpStackBack = #jmpStack 
            jmpPc = jmpStack[jmpStackBack] 

            table.remove(jmpStack)
            table.insert(program, {op_jmp_bck, jmpPc - 1})
            program[jmpPc][operand] = pc
        else
            -- by default
            pc = pc - 1
        end
        pc = pc + 1
    end
    if #jmpStack ~= 0 then
        return nil
    end

    return program
end

function executeBf(program)
    local string  = string
    local io      = io
    local data    = {}
    local dataPtr = 1
    for i = 1, 65535 do 
        data[i] = 0
    end
    local pc = 1
    local op = 0
    local programLen = #program
    while pc <= programLen do
        op = program[pc][operator]
        if op == op_inc_dp then
            dataPtr = dataPtr + 1
        elseif op == op_dec_dp then
            dataPtr = dataPtr - 1
        elseif op == op_inc_val then
            data[dataPtr] = data[dataPtr] + 1
        elseif op == op_dec_val then
            data[dataPtr] = data[dataPtr] - 1
        elseif op == op_out then
            io.write(string.char(data[dataPtr]))
        elseif op == op_in then
            os.exit("this method does not implement.")
        elseif op == op_jmp_fwd then
            if data[dataPtr] == 0 then
                pc = program[pc][operand]
            end
        elseif op == op_jmp_bck then
            if data[dataPtr] > 0 then
                pc = program[pc][operand]
            end
        else
            os.exit("Unknown operator: ".. program[pc][operator].."\n")
        end
        pc = pc + 1
    end
end


